import React from "react";

import { Container } from "./LoginStyle";
import NavBar from "../../Parts/LoginParts/NavBar";
import Body from "../../Parts/LoginParts/Body";
import Foot from "../../Parts/LoginParts/Foot";

const Login = () => {
    return (
        <Container>
            <NavBar />
            <Body />
            <Foot />
        </Container>
    );
};

export default Login;
